import React from "react";

class BadgesList extends React.Component {
	render(){
    return(

		<ul className="list-unsttyled">
			{this.props.badges.map((badge) => {
				<li key={badge.id}>
					<p>
						{badge.firstName}
						{badge.lastName}
					</p>
				</li>;
			})}
		</ul>
    )
  }

}

export default BadgesList;
